import React from 'react';
import {H1} from '../components'
import styled from 'styled-components';

const Style = styled.div`
	display: flex;
	align-self: flex-start;
	margin-top: 1rem;
	padding: 10px;
	position: relative;
	border: 5px solid black;
	width: 20%;
	height: 40%;
	margin-left: -6rem;

	&:nth-of-type(1) {
		margin-left: 0px;
	}

	&:nth-of-type(even) {
		align-self: flex-end;
	}

	.circle {
		border-color: white;
		border: 3px solid orange;
		border-radius: 50%;
		position: absolute;
		width: 20px;
		height: 20px;
		z-index: 1;

		bottom: -6rem - 10px;


	}
`;

class TimelineItem extends React.Component {
	render() {
		return(
	    	<Style>
	    		<H1>SUT BITCHES</H1>
	    		<p>And so it oges.</p>
	    		<span className='circle'></span>
	    	</Style>		    
		)
	;}
}

export default TimelineItem;
